func TestDirectoryTree_findParentDirectories(t *testing.T) {
	type args struct {
		masterUnresolvedDirectoryList *unresolvedDirectoryList
	}
	tests := []struct {
		name string
		got  DirectoryTree
		args args
		want DirectoryTree
	}{
		{
			name: "root dir",
			args: args{
				masterUnresolvedDirectoryList: &unresolvedDirectoryList{
					5: directory{
						DirectoryName:      "\\",
						ParentRecordNumber: 5,
					},
				}},
			want: DirectoryTree{
				5: "\\",
			},
		},
		{
			name: "depth one off root",
			args: args{
				masterUnresolvedDirectoryList: &unresolvedDirectoryList{
					5: directory{
						DirectoryName:      "\\",
						ParentRecordNumber: 5,
					},
					6: directory{
						DirectoryName:      "test",
						ParentRecordNumber: 5,
					},
				}},
			want: DirectoryTree{
				5: "\\",
				6: "\\test",
			},
		},
		{
			name: "depth two off root",
			args: args{
				masterUnresolvedDirectoryList: &unresolvedDirectoryList{
					5: directory{
						DirectoryName:      "\\",
						ParentRecordNumber: 5,
					},
					6: directory{
						DirectoryName:      "test",
						ParentRecordNumber: 5,
					},
					7: directory{
						DirectoryName:      "test2",
						ParentRecordNumber: 6,
					},
				}},
			want: DirectoryTree{
				5: "\\",
				6: "\\test",
				7: "\\test\\test2",
			},
		},
		{
			name: "orphan file",
			args: args{
				masterUnresolvedDirectoryList: &unresolvedDirectoryList{
					5: directory{
						DirectoryName:      "\\",
						ParentRecordNumber: 5,
					},
					7: directory{
						DirectoryName:      "test2",
						ParentRecordNumber: 6,
					},
				}},
			want: DirectoryTree{
				5: "\\",
				7: "$ORPHANFILE\\test2",
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			tt.got = make(DirectoryTree)
			tt.got.findParentDirectories(tt.args.masterUnresolvedDirectoryList)
			if !reflect.DeepEqual(tt.got, tt.want) {
				t.Errorf("Test %v failed \ngot = %v, \nwant = %v", tt.name, tt.got, tt.want)
			}
		})
	}
}

func TestDirectoryTree_resolve(t *testing.T) {
	type args struct {
		unresolvedDirectoryListChannel chan unresolvedDirectoryList
		waitForDirectoryResolution     sync.WaitGroup
	}
	tests := []struct {
		name                   string
		want                   DirectoryTree
		args                   args
		got                    DirectoryTree
		thingsToPutIntoChannel []unresolvedDirectoryList
	}{
		{
			name: "test1",
			args: args{
				unresolvedDirectoryListChannel: nil,
				waitForDirectoryResolution:     sync.WaitGroup{},
			},
			thingsToPutIntoChannel: []unresolvedDirectoryList{
				{
					5: directory{
						DirectoryName:      "\\",
						ParentRecordNumber: 5,
					},
					6: directory{
						DirectoryName:      "test",
						ParentRecordNumber: 5,
					},
				},
				{
					7: directory{
						DirectoryName:      "test2",
						ParentRecordNumber: 6,
					},
				},
			},
			want: DirectoryTree{
				5: "\\",
				6: "\\test",
				7: "\\test\\test2",
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			tt.got = make(DirectoryTree)
			tt.args.unresolvedDirectoryListChannel = make(chan unresolvedDirectoryList, 50)
			tt.args.waitForDirectoryResolution.Add(1)
			for _, value := range tt.thingsToPutIntoChannel {
				tt.args.unresolvedDirectoryListChannel <- value
			}
			close(tt.args.unresolvedDirectoryListChannel)
			tt.got.resolve(&tt.args.unresolvedDirectoryListChannel, &tt.args.waitForDirectoryResolution)
			if !reflect.DeepEqual(tt.got, tt.want) {
				t.Errorf("Test %v failed \ngot = %v, \nwant = %v", tt.name, tt.got, tt.want)
			}
		})
	}
}

